import './App.css';
import LandingView from './pages/landing.view/landing.view';
import PostcardView from './pages/posctcardview/postcardview';
import Post from './pages/';

import { LANDING, POSTCARD, POST } from './routes/routes';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
       <Router>
      <div>

        <Switch>
          <Route exact path={LANDING}>
            <LandingView />
          </Route>
          <Route path={POSTCARD}>
            <PostcarView />
          </Route>
          <Route path={POST}>
            <PostView />
          </Route>
        </Switch>
      </div>
    </Router>
    </div>
  );
}

export default App;
